*******************************************************************************
                               Gabelstapler-Simulator 2009
*******************************************************************************
Slip into the role of a forklift truck driver,
and take place in the highly detailed and original vehicles.

Forklift simulator in 2009, we varied tasks in different scenarios to master.
Thus, for example, trucks and trains in a given time and unloading of goods
or in the huge warehouses to store. Several original cars of the compan
y you are STILL in your fleet at your disposal.

An extensive training mode allows you to deal with the control of
the forklift and to raise for the missions needed to gain ticket stacker
. A free game in which you according to your wishes and control the
forklift truck can transport goods rounds from this simulation.
With Forklift Simulator 2009 you can experience a realistic forklift feeling to your home PC!
